import React from "react";

import ButtonStyledComp from "./ButtonStyledComp";
import ImageStyledComp from "./ImgStyledComp";

interface Props {
  title?: string;
  imgContent?: any;
  backgroundParam: string;
  paddingParam: string;
  boxShadowParam: string;
  colorBackBtn: string;
  paddingForImg?: string;
  onClick: () => void;
}

export const Button: React.FC<Props> = ({
  title,
  imgContent,
  backgroundParam,
  paddingParam,
  boxShadowParam,
  colorBackBtn,
  paddingForImg,
  onClick,
}) => {
  return (
    <ButtonStyledComp
      onClick={onClick}
      backgroundParam={backgroundParam}
      padding={paddingParam}
      boxShadow={boxShadowParam}
      colorBackBtn={colorBackBtn}
    >
      {title}
      {imgContent && (
        <ImageStyledComp
          marginForImg={paddingForImg}
          src={imgContent}
          alt="/"
        />
      )}
    </ButtonStyledComp>
  );
};
